import React from 'react';

import './App.css';
import Navbar from './components/Navbar'
import Slider from './components/slider/Slider';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

const App = () =>{
return (

  <Router>
  <Navbar />
  <Switch>
    <Route path="/" exact components={Home} />
    <Route path="/AboutApi" exact components={AboutApi} />
    <Route path="/ContactUs" exact components={ContactUs} />
    <Route path="/AboutUs" exact components={AboutUs} />
    <Route path="/KnowUs" exact components={KnowUs} />
    <Route path="/OurTeam" exact components={OurTeam} />
    <Route path="/OurWork" exact components={Home} />
    <Route path="/" exact components={Home} />
  </Switch>
  </Router>
  
  );
}

{/* <Slider />  */}

export default App
